INSERT INTO iskyshop_article (`id` ,`addTime` ,`deleteStatus` ,`content` ,`display` ,`mark` ,`sequence` ,`title` ,`url` ,`articleClass_id` ) VALUES ('32774', '2012-12-23 21:41:10.0', 0, '<p>\r\n	欢迎您对我们的站点、工作、产品和服务提出自己宝贵的意见或建议。我们将给予您及时答复。同时也欢迎您到我们公司来洽商业务。\r\n</p>\r\n<p>\r\n	<br />\r\n<strong>公司名称</strong>： 沈阳誉凯利明科技有限公司<br />\r\n<strong>通信地址</strong>： 沈阳市和平区十一纬路51号1218室<br />\r\n<strong>邮政编码</strong>： 100003<br />\r\n<strong>电话</strong>： 86-024-23268235<br />\r\n<strong>商务洽谈</strong>： 86-024-31323528<br />\r\n<strong>传真</strong>：86-024-23268235<strong></strong> \r\n</p>', 1, 'contact', '0', '联系我们 ', '', '163841');
